import React from 'react';
import PropTypes from 'prop-types';

// Utils
import { get } from '../api/callers';

// Styling
import { Flex, Box } from '../components/styles';

const Home = ({ cases }) => {
  console.log(cases);

  return (
    <Flex mb={32}>
      <Box>
        <h1>Home</h1>
      </Box>
    </Flex>
  );
};

Home.getInitialProps = async () => {
  const cases = await get('cases/').then(resp => resp?.cases);

  return { cases };
};

Home.propTypes = {
  cases: PropTypes.arrayOf(PropTypes.object),
};

Home.defaultProps = {
  cases: [],
};

export default Home;
